This section will cover defining a Rust function which can be called from a foreign language. For a Rust function to be callable from a foreign language you must use the extern keyword to specify the ABI. "C" is the default and most common option, see the reference for a full list. If the function should be name-able from outside Rust, you should use the #[no_mangle] attribute to prevent name mangling. You'll usually need this, unless the function is only used via a function pointer. E.g., #[no_mangle]
pub extern "C" fn foo() -> i32 { // ...
} You'll need to declare the function in foreign code to use it. In C/C++ this will look the same as declaring a C function (usually declared in headers as required). E.g., int foo();

