pub extern "C" foo() {} If you will call a function from foreign code by name then you must use no_mangle (not doing so may cause linking errors or may cause incorrect runtime behaviour). If you will only call a function via a function pointer, then you don't need to. Alternatively, you can use the export_name attribute to explicitly specify the name to use for the exported symbol. E.g., #[export_name = "bar"]
pub extern "C" foo() {} This function can be called using foo from Rust, and bar from C. Likewise, by default C++ will mangle function names. This is inconsistent between platforms and compilers, so it is not advisable to use the mangled names (this can be done if absolutely necessary and tools like bindgen and cxx can help with this TODO is this true?). To prevent name mangling, define functions in an extern "C" block. You can specify which section of the binary the function is placed in using the link_section attribute . Calling convention The extern keyword is used on function definitions to specify the calling convention (aka the ABI) used to call them (and on extern blocks to define the calling convention used to call the foreign functions declared inside, see above). The syntax is extern "ABI" where ABI is the optional ABI identifier string . E.g., pub extern "C" foo() {} If no ABI identifier is supplied, then C is used. If extern is not used at all, then Rust is used. The calling convention used in the declaration and definition of functions must match. This is likely to entail a somewhat complex interaction of defaults across different platforms and languages, and attributes in different languages. If you have control of both sides of the FFI, then making both extern "C" (either explicitly or by default) is probably the easiest option. You'll need to use other options if you want to match a calling convention in a library which cannot be changed. The platform independent ABI identifier strings are: Rust: Rust's ABI; this is unstable and should not be used for FFI code, C: the default C calling convention, system: the platform default calling convention for calling 'system functions'. Usually the same as extern "C", except on Win32, in which case it's "stdcall". The platform-specific ABI identifier strings are: cdecl: for x86_32 C code, stdcall: for the Win32 API on x86_32, win64: for C code on x86_64 Windows, sysv64: for C code on non-Windows x86_64, aapcs: for ARM, fastcall: corresponds to MSVC's __fastcall and GCC and clang's __attribute__((fastcall)), vectorcall: corresponds to MSVC's __vectorcall and clang's __attribute__((vectorcall)). You might also come across rust-intrinsic, rust-call, and platform-intrinsic. These are used by the compiler and standard library, but you shouldn't use them in user code. There also exist -unwind versions of the ABI identifier strings, e.g., C-unwind. These are all unstable , see the section below on unwinding for more details. TODO thiscall is unstable , see discussion on methods C/C++ linkage C/C++ functions must have external linkage (this is the default, i.e., functions may not be marked static). Signature The types of all arguments in the function and its return type as written in the declaration and definition must agree . For more on type agreement, see the sections on data types . The names of arguments do not need to match. In Rust declarations of foreign functions, _ may be used instead of an argument name. No other patterns may be used in arguments. Patterns may be used instead of names in the usual way for Rust functions which are exported; the foreign declarations should use a name instead of a pattern. The number of arguments in definition and declaration must match, including variadic arguments. Declarations (but not definitions) in Rust may be variadic (to match variadic functions defined in C). E.g., extern "C" { fn foo(format: *const u8, args: ...);
} If a function diverges, then in Rust it should have the ! return type. In C/C++ the function should have a 'no return' attribute (__attribute__((noreturn)), [[noreturn]], [[__noreturn__]], [[_Noreturn]], etc. depending on the language, version, and compiler). TODO what if sigs don't agree? If the return type must be used, then the Rust function should have the #[must_use] attribute and the C/C++ function the __attribute__((warn_unused_result)) attribute. TODO [[nodiscard]] on ctors. Getting this wrong will lead to missing warnings which may in turn lead to runtime errors.

